INSERT INTO `identity` (`identity_id`, `identity_name`, `identity_address`, `identity_phone`, `identity_wa`, `identity_owner`, `identity_logo`, `identity_about`, `created_at`, `updated_at`) VALUES
(1, 'TokoQit', 'Pasir Putih, Sawangan, Depok, Jabar. Indonesia', '+628 567 148813', '628567148813', 'Ibadi Ichsan, S.Kom', 'tokoqit_logo.png', '<div class=\"paragraph\">TokoQit adalah aplikasi kasir yang banyak dibutuhkan oleh perusahaan retail di Indonesia.</div>\n                                    <div class=\"paragraph\">Fitur aplikasi TokoQit diantaranya:\n                                        <ul>\n                                            <li>Pembuatan Nota</li>\n                                            <li>Manajemen Gudang</li>\n                                            <li>Laporan dalam rupiah, dollar dan euro</li>\n                                            <li>Multi Store</li>\n                                            <li>WA Blaster</li>\n                                            <li>Promo Bundling</li>\n                                            <li>Diskon Member</li>\n                                            <li>Cetak Kartu Member</li>\n                                        </ul>\n                                    </div>\n                                    <div class=\"paragraph\">TokoQit cocok bagi retail yang tidak ingin kesusahan dalam Manajemen Kasir. Selain itu aplikasi akan otomatis terupdate tanpa perlu keahlian IT tertentu.</div>\n                                    <div class=\"paragraph\">TokoQit memudahkan owner yang memiliki banyak toko untuk mengetahui laporan rugi laba setiap bulannya.</div>\n                                    <div class=\"paragraph\">Hubungi kami di 08567148813 untuk memiliki aplikasi yang luar biasa ini.</div>\n                                   \n                                    <div class=\"paragraph\">TokoQit dibuat oleh Qithy.com.</div>\n                                    ', '2022-07-13 23:54:08', '2022-07-13 23:54:08');
